import React, { useState, useEffect, useCallback } from 'react';
import { useNavigate } from 'react-router-dom';
import './OrderTable.css';

interface Order {
  _id: string;
  customerName: string;
  orderId: string;
  date: string;
  estimatedDeliveryDate: string;
  status: string;
  totalAmount: number;
}

const OrderTable: React.FC = () => {
  const navigate = useNavigate();
  const [orders, setOrders] = useState<Order[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  const [editingId, setEditingId] = useState<string | null>(null);

  const fetchOrders = useCallback(async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        navigate('/login');
        return;
      }

      const response = await fetch('http://localhost:5001/api/orders', {
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        }
      });

      if (response.status === 401) {
        navigate('/login');
        return;
      }

      if (response.status === 403) {
        setError('Access denied. Admin privileges required.');
        setLoading(false);
        return;
      }

      if (!response.ok) {
        throw new Error('Failed to fetch orders');
      }

      const data = await response.json();
      setOrders(data);
      setLoading(false);
    } catch (err) {
      setError('Error fetching orders');
      setLoading(false);
      console.error('Error:', err);
    }
  }, [navigate]);

  useEffect(() => {
    fetchOrders();
  }, [fetchOrders]);

  const handleSignOut = () => {
    localStorage.removeItem('token');
    localStorage.removeItem('user');
    navigate('/login');
  };

  const handleEdit = async (id: string, field: keyof Order, value: string) => {
    try {
      const token = localStorage.getItem('token');
      if (!token) {
        navigate('/login');
        return;
      }

      const response = await fetch(`http://localhost:5001/api/orders/${id}`, {
        method: 'PATCH',
        headers: {
          'Authorization': `Bearer ${token}`,
          'Content-Type': 'application/json'
        },
        body: JSON.stringify({ [field]: value })
      });

      if (response.status === 401) {
        navigate('/login');
        return;
      }

      if (!response.ok) {
        throw new Error('Failed to update order');
      }

      setOrders(orders.map(order => 
        order._id === id ? { ...order, [field]: value } : order
      ));
      setEditingId(null);
    } catch (err) {
      console.error('Error updating order:', err);
      setError('Failed to update order. Please try again.');
    }
  };

  const handleEditStart = (id: string) => {
    setEditingId(id);
  };

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (error) {
    return <div className="error-message">{error}</div>;
  }

  return (
    <div className="order-table-container">
      <header>
        <nav>
          <a href="/">Home</a>
          <a href="/gallery">Gallery</a>
          <a href="/orders">Orders</a>
          <a href="/contact">Contact</a>
        </nav>
        <button className="sign-out-btn" onClick={handleSignOut}>
          Sign Out
        </button>
      </header>

      <h2>Order Management</h2>

      <div className="table-wrapper">
        <table>
          <thead>
            <tr>
              <th>Serial Number</th>
              <th>Customer Name</th>
              <th>Order ID</th>
              <th>Date</th>
              <th>Estimated Delivery Date</th>
              <th>Status</th>
              <th>Total Amount</th>
            </tr>
          </thead>
          <tbody>
            {orders.map((order, index) => (
              <tr key={order._id} className={editingId === order._id ? 'editing' : ''}>
                <td>{index + 1}</td>
                <td
                  contentEditable
                  onFocus={() => handleEditStart(order._id)}
                  onBlur={(e) => handleEdit(order._id, 'customerName', e.currentTarget.textContent || '')}
                >
                  {order.customerName}
                </td>
                <td>{order.orderId}</td>
                <td>{order.date}</td>
                <td
                  contentEditable
                  onFocus={() => handleEditStart(order._id)}
                  onBlur={(e) => handleEdit(order._id, 'estimatedDeliveryDate', e.currentTarget.textContent || '')}
                >
                  {order.estimatedDeliveryDate}
                </td>
                <td
                  contentEditable
                  onFocus={() => handleEditStart(order._id)}
                  onBlur={(e) => handleEdit(order._id, 'status', e.currentTarget.textContent || '')}
                >
                  {order.status}
                </td>
                <td>${order.totalAmount.toFixed(2)}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default OrderTable;
